import { Injectable } from '@angular/core';

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';

pdfMake.vfs = pdfFonts as any as typeof pdfMake.vfs;




@Injectable({
  providedIn: 'root',
})
export class PdfService {
  crearPdf(data: any[]) {

    const dia = new Date(Date.now());
    console.log(dia.getDate())
    const diaFormateado = `${dia.getDate()}/${dia.getMonth()+1}/${dia.getFullYear()}`
    const headers = ['Fecha', 'Especialidad', 'Diagnóstico', 'Comentario', 'Altura', 'Peso', 'Temperatura', 'Presión'];

    const body: any[] = [];
    body.push(headers); 

    for (let turno of data) {
      const datos = turno.turnos_datos?.[0] || {};
      body.push([
        turno.fecha || '',
        turno.especialidad || '',
        turno.diagnostico || '',
        turno.comentario_especialista || '',
        datos.altura || '',
        datos.peso || '',
        datos.temperatura || '',
        datos.presion || ''
      ]);
    }

    const docDefinition: any = {
      content: [
        {width: 100,image:'data:image/png;base64,'},
        
        { text: 'Historial de Turnos', style: 'header' },
        { text: diaFormateado, style: 'header' },

        {
          table: {
            headerRows: 1,
            widths: ['auto', '*', '*', '*', 40, 40, 50, 40],
            body: body
          },
          fontSize: 8
        }
      ],
      styles: {
        header: {
          fontSize: 12,
          bold: true,
          margin: [0, 0, 0, 10]
        },
        body:{
          fontSize: 5
        }
      }
    };

    pdfMake.createPdf(docDefinition).open();
  }
}
